import './App.css';

import {DB_CONFIG} from './Config/insta-config';

/*
  Link to instagram page:
  https://www.instagram.com/n.y.b.clothing/?hl=en

  Link to etsy page:
  https://www.etsy.com/ca/shop/NYBclothing
*/
class App extends Component {

  constructor(props){
    //console.log(DB_CONFIG);

  };


  render(){



    return (
      <div>

        <div>
          <h3>N Y B  Clothing</h3>
        </div>

        <div className="topnav">
          <div className="dropdown">
            <button className="dropbtn">Shop
              <i className="fa fa-caret-down"></i>
            </button>
            <div className="dropdown-content">
              <a>Link 1</a>
              <a>Link 2</a>
              <a>Link 3</a>
            </div>
          </div>
          <a>Sell</a>
          <a>Inspiration</a>
          <a>About us</a>
          <a>Contact us</a>
        </div>

      </div>
    );
  }

}

export default App;
